import React from 'react';
import './SideDrawer.css'

function SideDrawer(){
    return(
        <div className="side-drawer-class">
            <ul>
                <li>
                    <p>Passion</p>
                </li>
                <li>
                    <p>Projects</p>
                </li>
                <li>
                    <p>Contact</p>
                </li>
            </ul>
        </div>
    )
}

export default SideDrawer;
